import React from 'react';
import './ButtonResume.scss';

export default function MatchHistory() {
    return (
        <div id="buttonresume">
        {/* On fera un map ensuite pour boucler proprement sur les matchs */}
            <p id="buttonresume--result">
                <span className="player1">Player 1 </span> 
                - <span className="score-player-1">score</span> 
                 / 
                 <span className="score-player-2">score </span> - 
                 Player 2
            </p>
        </div>
    )
}
